SELECT COUNT(*) FROM comments as c, posts as p, postLinks as pl, postHistory as ph, votes as v WHERE p.Id = c.PostId AND p.Id = pl.PostId AND p.Id = ph.PostId AND p.Id = v.PostId AND c.CreationDate >= '2012-09-08 22:02:34'::timestamp AND p.Score <= 94 AND p.FavoriteCount >= 33 AND p.FavoriteCount <= 133 AND p.CreationDate >= '2011-01-31 02:06:30'::timestamp AND p.CreationDate <= '2014-07-09 07:45:52'::timestamp AND pl.LinkTypeId = 1 AND pl.CreationDate <= '2012-05-23 17:52:22'::timestamp AND ph.CreationDate >= '2012-08-28 18:21:32'::timestamp AND v.CreationDate <= '2011-12-14 08:28:10'::timestamp;